export function ColorSwatch({ label, color1, color2 }) {
  const {
    theme: { color },
  } = useTheme()
  return (
    <Container
      css={`
        text-align: center;
        margin: 5px;
      `}
      marginBottom={4}>
      <Flex
        elevate={5}
        css={`
          width: 100px;
          margin: 24px auto 8px auto;
        `}>
        <Container
          css={`
            background: ${color[color1]};
            height: 100px;
            width: 50px;
          `}
        />
        <Container
          css={`
            background: ${color[color2 || color1]}
            height: 100px;
            width: 50px;
            display: inline-block
            `}
        />
      </Flex>
      <br />
      {label}
    </Container>
  )
}
